import React, { useState, useEffect } from 'react';
import MaterialTable from 'material-table';
import axios from 'axios';
import { Button } from '@mui/material';
import { Add as AddIcon } from '@mui/icons-material';

const Pacientes = () => {
    const [pacientes, setPacientes] = useState([]);

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = async (searchText = '') => {
        try {
            const token = localStorage.getItem('token');
            const response = await axios.get('http://localhost:3002/api/persona/listar', {
                headers: {
                    Authorization: `Bearer ${token}`
                },
                params: {
                    texto: searchText
                }
            });
            setPacientes(response.data.data);
        } catch (error) {
            console.error('Error fetching data: ', error);
        }
    };

    return (
        <div>
            <h1>Paciente</h1>
            <Button
                variant="contained"
                color="success"
                startIcon={<AddIcon />}
                onClick={() => console.log('Agregar')}
            >
                Agregar
            </Button>
            <MaterialTable
                title="Pacientes"
                columns={[
                    { title: 'Opciones', field: 'opciones', render: rowData => (
                            <div>
                                <Button
                                    variant="contained"
                                    color="warning"
                                    onClick={() => console.log('Editar', rowData.idpersona)}
                                >
                                    Editar
                                </Button>
                                <Button
                                    variant="contained"
                                    color="info"
                                    onClick={() => console.log('Ver Historia', rowData.idpersona)}
                                >
                                    Ver Historia
                                </Button>
                            </div>
                        ) },
                    { title: 'Apellido Paterno', field: 'apaterno' },
                    { title: 'Apellido Materno', field: 'amaterno' },
                    { title: 'Nombre', field: 'nombre' },
                    { title: 'Fecha de Nacimiento', field: 'fecha_nacimiento' },
                    { title: 'Sexo', field: 'sexo' },
                    { title: 'Estado Civil', field: 'estado_civil' },
                    { title: 'Numero de Documento', field: 'num_documento' },
                    { title: 'Direccion', field: 'direccion' },
                    { title: 'Teléfono', field: 'telefono' },
                ]}
                data={pacientes}
                options={{
                    search: true,
                    paging: true,
                    filtering: true
                }}
                localization={{
                    pagination: {
                        labelDisplayedRows: '{from}-{to} de {count}',
                        labelRowsSelect: 'filas',
                        labelRowsPerPage: 'Filas por página:',
                        firstAriaLabel: 'Primera página',
                        firstTooltip: 'Primera página',
                        previousAriaLabel: 'Página anterior',
                        previousTooltip: 'Página anterior',
                        nextAriaLabel: 'Siguiente página',
                        nextTooltip: 'Siguiente página',
                        lastAriaLabel: 'Última página',
                        lastTooltip: 'Última página',
                    },
                    toolbar: {
                        nRowsSelected: '{0} fila(s) seleccionada(s)',
                        searchTooltip: 'Buscar',
                        searchPlaceholder: 'Buscar',
                    },
                    header: {
                        actions: 'Acciones'
                    },
                    body: {
                        emptyDataSourceMessage: 'No hay datos',
                        filterRow: {
                            filterTooltip: 'Filtrar'
                        }
                    }
                }}
            />
        </div>
    );
};

export default Pacientes;
